import React, { Component } from 'react';

class Auth extends Component {
    login(){
        console.log ("Login Called",this.state)
        fetch('http://localhost:8000/login',{
            method:"POST",
            headers:{
                "Accept":"manifest/json",
                "Content-Type":"manifest/json",
            },
            body:JSON.stringify(this.state)
        })
    }
    render(){
        return(
            <div>
                <div>
                    <input type = "text" placeholder="Enter Name" onChange={(e) => {this.setState({name:e.target.value})}} /><br/> <br/>
                    <input type = "text" placeholder="Enter Email" onChange={(e) => {this.setState({email:e.target.value})}} /><br/> <br/>
                    <button onClick={() => this.login()}>Login</button>
                </div>
            </div>
        )
    }
}

export default Auth;
